tables.table_schema:
CREATE TABLE employee_benefits (
    employee_id INT NOT NULL,
    insurance_coverage DECIMAL(10, 2) NOT NULL,
    retirement_plan DECIMAL(10, 2) NOT NULL
);

CREATE TABLE employees (
    employee_id INT PRIMARY KEY,
    employee_name STRING,
    insurance_coverage DECIMAL,
    retirement_plan DECIMAL
);

CREATE TABLE benefits (
    benefit_id INT PRIMARY KEY,
    benefit_type STRING,
    coverage_amount DECIMAL
);

CREATE TABLE employees (
    employee_id INT PRIMARY KEY,
    name VARCHAR(255),
    department VARCHAR(255),
    hire_date DATE
);

CREATE TABLE insurance_coverage (
  employee_id UUID,
  coverage_type STRING,
  coverage_amount FLOAT
);

CREATE TABLE retirement_plans (
  plan_id UUID,
  plan_type STRING,
  contribution_amount FLOAT
);

CREATE TABLE employee_info (
  employee_id UUID,
  employee_name STRING,
  employee_department STRING
);

CREATE TABLE benefits_history (
  employee_id UUID,
  event_date DATE,
  event_description STRING
);
